import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Header from './components/Header/header';
import './components/Header/header.css';
import './components/MainPart/main_part.css';
import './components/PhotosPart/photos_part.css';
import './components/Bottom/bottom.css';
import './components/Footer/footer.css';
import Catalog from './components/Catalog/catalog';
import Home from './components/Home/home';
import Cart from './components/Cart/cart';

function App() {
    const [homeButtonColor, setHomeButtonColor] = useState('black');
    const [catalogButtonColor, setCatalogButtonColor] = useState('black');
    const [cartButtonColor, setCartButtonColor] = useState('black');

    return (
        <Router>
            <div>
                <Header
                    homeButtonColor={homeButtonColor}
                    catalogButtonColor={catalogButtonColor}
                    cartButtonColor={cartButtonColor}
                    setHomeButtonColor={setHomeButtonColor}
                    setCatalogButtonColor={setCatalogButtonColor}
                    setCartButtonColor={setCartButtonColor}
                />
                <Routes>
                    <Route path="/Home" element={<Home />} />
                    <Route path="/Catalog" element={<Catalog />} />
                    <Route path="/Cart" element={<Cart />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
